Looks like the console.log file of a CentOS image is different than one of a Ubuntu image.

*CentOS (which fails)*

{code}
# file /instances/work/4XVKCF4WDM4NAIXBORW99/i-B0B742A2/console.log
/instances/work/4XVKCF4WDM4NAIXBORW99/i-B0B742A2/console.log: ISO-8859 English text, with very long lines, with CRLF, CR, LF line terminators, with escape sequences
{code}

*Ubuntu (which works)*

{code}
# file /instances/work/4XVKCF4WDM4NAIXBORW99/i-0CD23F7B/console.log
/instances/work/4XVKCF4WDM4NAIXBORW99/i-0CD23F7B/console.log: ASCII English text, with very long lines, with CRLF, CR, LF line terminators, with escape sequences
{code}

Maybe this will help - http://effbot.org/zone/unicode-objects.htm ?

I tried this workaround, maybe its not a proper fix but it did work for me

Modify line highlighted in the below link https://github.com/eucalyptus/euca2ools/blob/39e2192750afedc8a60ffe5d19df10ea94ddb174/euca2ools/commands/euca/getconsoleoutput.py#L59 (local file /usr/lib/python2.6/site-packages/euca2ools/commands/euca/getconsoleoutput.py)

Original

{code}
59       output = output.decode()
{code}

Modified

{code}
59       output = output.decode('utf-8')
{code}

This worked. I am using RHEL 6.4 x86_64 with python 2.6.6 and euca2ools-3.0.0-0.20.el6.noarch.
